import{_ as o,o as r,c as a,z as e,a as t}from"./chunks/framework.9482e208.js";const b=JSON.parse('{"title":"§ 17.1-268 Fee for effort to serve when person cannot be found.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/17.1-268.md","filePath":"vacode/17.1-268.md"}'),n={name:"vacode/17.1-268.md"},s=e("h1",{id:"§-17-1-268-fee-for-effort-to-serve-when-person-cannot-be-found",tabindex:"-1"},[t("§ 17.1-268 Fee for effort to serve when person cannot be found. "),e("a",{class:"header-anchor",href:"#§-17-1-268-fee-for-effort-to-serve-when-person-cannot-be-found","aria-label":'Permalink to "§ 17.1-268 Fee for effort to serve when person cannot be found."'},"​")],-1),i=e("p",null,"Whenever a sheriff is required to serve a declaration in ejectment or an order, notice, summons or other process in a pending civil case and make return thereon and shall after due effort and without fault be unable to locate such person or make service of such process in some method provided by law, the sheriff shall be paid the same fee provided by law for serving an order, notice or other process and making return thereof, to be taxed as other costs. When service is required in a proceeding not pending in a court then the service shall be paid for by the party at whose instance it is had. No fee shall be paid unless the sheriff returns such paper unexecuted and makes and files therewith an affidavit setting forth the fact that he has made diligent effort to execute such paper and without avail.",-1),c=e("p",null,[t("Code 1950, § 14-107; 1964, c. 386, § 14.1-96; 1971, Ex. Sess., c. 155; 1998, c. "),e("a",{href:"http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0872",target:"_blank",rel:"noreferrer"},"872"),t(".")],-1),d=[s,i,c];function f(h,l,p,u,v,_){return r(),a("div",null,d)}const g=o(n,[["render",f]]);export{b as __pageData,g as default};
